import React from 'react';

const ZoomCompletedModalBody = () => {
  return (
    <div>
      <h3>줌 미팅 완료 상태입니다</h3>
      <p>학생이 줌 미팅을 완료했어요. 다음 단계를 진행해주세요.</p>
    </div>
  );
};

export default ZoomCompletedModalBody;
